pragma solidity ^0.4.23;
pragma experimental ABIEncoderV2;

import "../acl/ACLV1.sol";
import "../acl/ACLRequiring.sol";
import "../lifecycle/Pausable.sol";
import "./ProductStoreProxy.sol";
import "./ProductStoreV1.sol";

/**
* @title ProductStoreFactory
* @dev Factory for ProductStore contracts
*/
contract ProductStoreFactory is ACLRequiring, Pausable {

  /**
  * @dev Constructor function
  * @param _aclAddress Address of ACL contract
  */
  constructor(address _aclAddress) Pausable(_aclAddress) public { }

  /**
  * @dev Produces a ProductStore and ProductStoreProxy linked to the store
  * @return ProductStoreProxy contract
  */
  function makeProductStore() public onlyAuthorized whenNotPaused returns (ProductStoreProxy) {
    ACLV1 acl = new ACLV1();
    ProductStoreV1 store = new ProductStoreV1(address(acl));
    ProductStoreProxy proxy = new ProductStoreProxy(address(acl));
    proxy.upgradeTo(store);
    return proxy;
  }

}
